        <Route path="/home/packages/create" element={<Create />}></Route>
        <Route path="/home/createproduct" element={<CreateProduct />}></Route>
        <Route path="/home/mycart" element={<Cart />}></Route>
        <Route path="/home/addaddress" element={<AddAdress />}></Route>
        <Route path="/home/addProduct" element={<ProductCart />}></Route> */}
        </Switch>
      </Router>
    </div >
  )
}
export default App
